INSERT INTO `lesson_step_hints` VALUES (1,33,'Total Current Assets is the sum of all Current Assets. Total Assets is the sum of \'Total Current Assets\' and all the companyâ€™s other assets.','2020-03-30 00:00:00','2020-03-30 00:00:00'),(2,34,'The accounting equation is Total Assets = Total Liabilities and Equities','2020-03-30 00:00:00','2020-03-30 00:00:00'),(3,42,'Divide \"Income Taxes\" by \"Taxable Income\"','2020-03-30 00:00:00','2020-03-30 00:00:00'),(4,47,'(accounts payable/Cost of Goods Sold)*365','2020-03-30 00:00:00','2020-03-30 00:00:00'),(5,55,'Revenue*(1-% margin)','2020-03-30 00:00:00','2020-03-30 00:00:00'),(6,60,'(Collection period/365)*Revenue','2020-03-30 00:00:00','2020-03-30 00:00:00'),(11,62,'(Days outstanding/365)*COGS','2020-03-30 00:00:00','2020-03-30 00:00:00'),(12,66,'In cell F42, type \'=E42-F83-F21\'. You have to subtract CapEx since we\'re showing it as a negative number on the Cashflow statement.','2020-03-30 00:00:00','2020-03-30 00:00:00'),(13,67,'You need to use the \'MIN\' formula. Still having trouble? Check the second hint below.','2020-03-30 00:00:00','2020-03-30 00:00:00'),(14,67,'In cell F90, type \'=-MIN(E54,F87)\'. You are taking the minimum value between your existing revolver balance and the cash available from operating activities. If your cash flow from operating activities is negative, it will always be lower than your existing balance. But you want the revolver to be a source of cash that is equal to your operating cash outflow. If you have an existing balance on the revolver, you want to use the cash from your operating activities to pay it down.','2020-03-30 00:00:00','2020-03-30 00:00:00'),(15,69,'=AVERAGE(E55:F55)*F69','2020-03-30 00:00:00','2020-03-30 00:00:00'),(16,1,'=E58+F76+F93+F95','2020-03-30 00:00:00','2020-03-30 00:00:00');
