able\": {}}, \"name\": \"Sheet2\", \"index\": 1, \"theme\": \"Office\", \"cellStates\": {}, \"selections\": {\"0\": {\"col\": 0, \"row\": 0, \"colCount\": 1, \"rowCount\": 1}, \"length\": 1}, \"topCellIndex\": 0, \"colHeaderData\": {}, \"leftCellIndex\": 0, \"rowHeaderData\": {}, \"autoMergeRangeInfos\": [], \"outlineColumnOptions\": {}}}, \"version\": \"13.0.4\", \"customList\": [], \"sheetCount\": 2}','One of the cells is not showing the expected value. Double check the cells with red borders to ensure they match the instructions'),(3,1,1,1,'Overview','<p>Throughout this lesson, you will learn the elements of a simple 3-statement financial model. The three core financial statements are the income statement, the balance sheet, and the cash flow statement. These statements are the basis for any analysis of a company. It\'s the starting point for valuations, comparisons against other companies, evaluation of a companyâ€™s budget, among many other things.</p>\r\n\r\n                                        <p>You will be building each of these statements for an illustrative software company called \"FakeSoftwareCo\" for an 8 year time period going from 2017 to 2024. There are 12 sections we will work through to build this model.</p>\r\n\r\n                                        <p>The income statement shows you a company\'s profitability over a time period. The cash flow statement shows how cash moves in and out of the business over a time period. We\'ll explain in more detail later, but the two statements are different because the accounting principles that define profitability are not tied to when you pay or receive cash payment.</p>\r\n\r\n                                        <p>The third statement, you\'ll learn how to build is the balance sheet. The balance sheet is different from the other two statements because it shows information at a single point in time. It shows at the end of the time period, what assets the company has and how those assets are financed.</p>',0,'','{\"sheets\": {\"Sheet1\": {\"data\": {\"dataTable\": {}, \"defaultDataNode\": {\"style\": {\"themeFont\": \"Body\"}}}, \"name\": \"Sheet1\", \"index\": 0, \"theme\": \"Office\", \"columns\": [null, {\"size\": 212}], \"activeCol\": 1, \"activeRow\": 1, \"printInfo\": {\"paperSize\": {\"kind\": 1, \"width\": 850, \"height\": 1100}}, \"cellStates\": {}, \"selections\": {\"0\": {\"col\": 1, \"row\": 1, \"colCount\": 1, \"rowCount\": 1}, \"length\": 1}, \"topCellIndex\": 0, \"colHeaderData\": {\"defaultDataNode\": {\"style\": {\"themeFont\": \"Body\"}}}, \"leftCellIndex\": 0, \"rowHeaderData\": {\"defaultDataNode\": {\"style\": {\"themeFont\": \"Body\"}}}, \"autoMergeRangeInfos\": [], \"outlineColumnOptions\": {}}, \"Sheet2\": {\"data\": {\"dataTable\": {}}, \"name\": \"Sheet2\", \"index\": 1, \"theme\": \"Office\", \"cellStates\": {}, \"selections\": {\"0\": {\"col\": 0, \"row\": 0, \"colCount\": 1, \"rowCount\": 1}, \"length\": 1}, \"topCellIndex\": 0, \"colHeaderData\": {}, \"leftCellIndex\": 0, \"rowHeaderData\": {}, \"autoMergeRangeInfos\": [], \"outlineColumnOptions\": {}}}, \"version\": \"13.0.4\", \"customList\": [], \"sheetCount\": 2}','One of the cells is not showing the expected value. Double check the cells with red borders to ensure they match the instructions'),(4,1,1,2,'Overview','<p>The first step in building out a full financial model, is to find the information you need about the company. For the sake of this course, we\'re going to assume that you have the information you need to build the model. For our work we\'re going to start by labeling the income statement.</p>\r\n\r\n                                        <p>Once you have the information, you want to lay out the structure in your spreadsheet. Letâ€™s start with the Income Statement.</p>\r\n										\r\n										<p>In cell B2, type \"FakeSoftwareCo Income Statement\" so that we have a header for the first statement. In the column label at the top of the spreadsheet, double click on the line between column B and column C so that the entire label shows.</p>',0,'','{\"sheets\": {\"Sheet1\": {\"data\": {\"dataTable\": {\"1\": {\"1\": {\"value\": \"FakeSoftwareCo Income Statement\"}}}, \"defaultDataNode\": {\"style\": {\"themeFont\": \"Body\"}}}, \"name\": \"Sheet1\", \"index\": 0, \"theme\": \"Office\", \"columns\": [null, {\"size\": 212}], \"activeCol\": 1, \"activeRow\": 1, \"printInfo\": {\"paperSize\": {\"kind\": 1, \"width\": 850, \"height\": 1100}}, \"cellStates\": {}, \"selections\": {\"0\": {\"col\": 1, \"row\": 1, \"colCount\": 1, \"rowCount\": 1}, \"length\": 1}, \"topCellIndex\": 0, \"colHeaderData\": {\"defaultDataNode\": {\"style\": {\"themeFont\": \"Body\"}}}, \"leftCellIndex\": 0, \"rowHeaderData\": {\"defaultDataNode\": {\"style\": {\"themeFont\": \"Body\"}}}, \"autoMergeRangeInfos\": [], \"outlineColumnOptions\": {}}, \"Sheet2\": {\"data\": {\"dataTable\": {}}, \"name\": \"Sheet2\", \"index\": 1, \"theme\": \"Office\", \"cellStates\": {}, \"selections\": {\"0\": {\"col\": 0, \"row\": 0, \"colCount\": 1, \"rowCount\": 1}, \"length\": 1}, \"topCellIndex\": 0, \"colHeaderData\": {}, \"leftCellIndex\": 0, \"rowHeaderData\": {}, \"autoMergeRangeInfos\": [], \"outlineColumnOptions\": {}}}, \"version\": \"13.0.4\", \"customList\": [], \"sheetCount\": 2}','One of the cells is not showing the expected value. Double check the cells with red borders to ensure they match the instructions'),(5,1,1,3,'Overview','<p>Formatting is an extremely important part of financial modeling because it determines whether people can clearly understand and interpret your document. We will format the content as we go through this course. The formatting we do in this course is just one of several ways that you could format a model.</p>\r\n\r\n                                        <p>Fill the background in cells B2:J2 with a dark blue fill by clicking on the paint can in the menu bar and selecting dark blue. Then in cell B2, select the \"A\" next to the pain