\"borderBottom\": {\"style\": 1}}, \"value\": 2018}, \"4\": {\"style\": {\"borderBottom\": {\"style\": 1}}, \"value\": 2019}, \"5\": {\"style\": {\"borderBottom\": {\"style\": 1}}, \"value\": 2020}, \"6\": {\"style\": {\"borderBottom\": {\"style\": 1}}, \"value\": 2021}, \"7\": {\"style\": {\"borderBottom\": {\"style\": 1}}, \"value\": 2022}, \"8\": {\"style\": {\"borderBottom\": {\"style\": 1}}, \"value\": 2023}, \"9\": {\"style\": {\"borderBottom\": {\"style\": 1}}, \"value\": 2024}}}, \"defaultDataNode\": {\"style\": {\"themeFont\": \"Body\"}}}, \"name\": \"Sheet1\", \"rows\": [null, null, {\"size\": 5}], \"index\": 0, \"theme\": \"Office\", \"columns\": [null, {\"size\": 216}], \"activeCol\": 4, \"activeRow\": 9, \"printInfo\": {\"paperSize\": {\"kind\": 1, \"width\": 850, \"height\": 1100}}, \"cellStates\": {}, \"selections\": {\"0\": {\"col\": 4, \"row\": 9, \"colCount\": 1, \"rowCount\": 1}, \"length\": 1}, \"topCellIndex\": 0, \"colHeaderData\": {\"defaultDataNode\": {\"style\": {\"themeFont\": \"Body\"}}}, \"leftCellIndex\": 0, \"rowHeaderData\": {\"defaultDataNode\": {\"style\": {\"themeFont\": \"Body\"}}}, \"autoMergeRangeInfos\": [], \"outlineColumnOptions\": {}}, \"Sheet2\": {\"data\": {\"dataTable\": {}}, \"name\": \"Sheet2\", \"index\": 1, \"theme\": \"Office\", \"cellStates\": {}, \"selections\": {\"0\": {\"col\": 0, \"row\": 0, \"colCount\": 1, \"rowCount\": 1}, \"length\": 1}, \"topCellIndex\": 0, \"colHeaderData\": {}, \"leftCellIndex\": 0, \"rowHeaderData\": {}, \"autoMergeRangeInfos\": [], \"outlineColumnOptions\": {}}}, \"version\": \"13.0.4\", \"customList\": [], \"sheetCount\": 2}','One of the cells is not showing the expected value. Double check the cells with red borders to ensure they match the instructions'),(9,1,2,1,'Income Statement Set Up','<p>Now that we\'ve labeled the income statement, we can add each of its line items. Each line item represents money earned by the company or costs that the company incurs. The first line on the income statement is Revenue. The revenue is the money that a company has earned during a period. In finance and accounting revenue does not count as earned until you deliver the service. So, for example, if someone pays cash for something, and then you deliver it a month later. You don\'t count the revenue until you\'ve delivered the product.</p>\r\n\r\n                                        <p>When you\'re calculating revenue, how you break it down can vary based on what matters to the company. You could show it by business unit, by geography, or by customer segment. In this model, we are going to break out the revenue by whether or not it is recurring. Specifically, we will use subscription and license revenue.</p>\r\n\r\n                                        <p>Type \"Subscription Revenue\" in cell B5, \"License Revenue\" in cell B6, and \"Total Revenue\" in cell B7. We want to indicate that Subscription and License revenue are part of revenue. Indent cells B5 and B6 by selecting the alignment menu to the right of the font color menu and clicking \"Increase Indent\" at the bottom. Then to show that Total Revenue is a cumulative value, select cells B7:J7 and add a top border</p>',0,'','{\"sheets\": {\"Sheet1\": {\"data\": {\"dataTable\": {\"1\": {\"1\": {\"style\": {\"font\": \"bold 14.6667px Calibri\", \"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}, \"value\": \"FakeSoftwareCo Income Statement\"}, \"2\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"3\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"4\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"5\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"6\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"7\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"8\": {\"style\