 5, \"colCount\": 1, \"rowCount\": 1}, \"length\": 1}, \"topCellIndex\": 0, \"colHeaderData\": {\"defaultDataNode\": {\"style\": {\"themeFont\": \"Body\"}}}, \"leftCellIndex\": 0, \"rowHeaderData\": {\"defaultDataNode\": {\"style\": {\"themeFont\": \"Body\"}}}, \"autoMergeRangeInfos\": [], \"outlineColumnOptions\": {}}, \"Sheet2\": {\"data\": {\"dataTable\": {}}, \"name\": \"Sheet2\", \"index\": 1, \"theme\": \"Office\", \"cellStates\": {}, \"selections\": {\"0\": {\"col\": 0, \"row\": 0, \"colCount\": 1, \"rowCount\": 1}, \"length\": 1}, \"topCellIndex\": 0, \"colHeaderData\": {}, \"leftCellIndex\": 0, \"rowHeaderData\": {}, \"autoMergeRangeInfos\": [], \"outlineColumnOptions\": {}}}, \"version\": \"13.0.4\", \"customList\": [], \"sheetCount\": 2}','One of the cells is not showing the expected value. Double check the cells with red borders to ensure they match the instructions'),(10,1,2,2,'Income Statement Set Up','<p>The next line on the income statement is Cost of Goods sold, commonly shortened as COGS. COGS are the material costs necessary to deliver the product to your customers. Taking a simple example, if you make wooden chairs, COGS would include the cost of the wood, the cost of the tools you used to carve the chair, and the cost of your time to carve the chair. It would not include any money you spend to market the chair.</p>\r\n\r\n                                        <p>The difference between your revenue and cost of goods sold is called Gross Margin. Gross Margin tells you how much it cost a company to make the products they sell. What\'s considered a good Gross Margin varies based on the type of business you\'re dealing with. For a software company, gross margins are usually higher than 70%. On the other extreme end of the spectrum grocery stores have gross margins in the 20 to 30% range.</p>\r\n\r\n                                        <p>In cell B9 type \"Cost of Goods Sold\" and in cell B10 type \"Gross Margin\". Indent cell B9 and add a top border to cells B10:J10.</p>',0,'','{\"sheets\": {\"Sheet1\": {\"data\": {\"dataTable\": {\"1\": {\"1\": {\"style\": {\"font\": \"bold 14.6667px Calibri\", \"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}, \"value\": \"FakeSoftwareCo Income Statement\"}, \"2\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"3\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"4\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"5\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"6\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"7\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"8\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"9\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}}, \"3\": {\"1\": {\"style\": {\"font\": \"italic 14.6667px Calibri\", \"borderBottom\": {\"style\": 1}}, \"value\": \"($ in millions)\"}, \"2\": {\"style\": {\"borderBottom\": {\"style\": 1}}, \"value\": 2017}, \"3\": {\"style\": {\"borderBottom\": {\"style\": 1}}, \"value\": 2018}, \"4\": {\"style\": {\"borderBottom\": {\"style\": 1}}, \"value\": 2019}, \"5\": {\"style\": {\"borderBottom\": {\"style\": 1}}, \"value\": 2020}, \"6\": {\"style\": {\"borderBottom\": {\"style\": 1}}, \"value\": 2021}, \"7\": {\"style\": {\"borderBottom\": {\"style\": 1}}, \"value\": 2022}, \"8\": {\"style\": {\"borderBottom\": {\"style\": 1}}, \"value\": 2023}, \"9\": {\"style\": {\"borderBottom\": {\"style\": 1}}, \"value\": 2024}}, \"4\": {\"1\": {\"style\": {\"textIndent\": 1, \"textOrientation\": 0}, \"value\": \"Subscription Revenue\"}}, \"5\": {\"1\": {\"style\": {\"textIndent\": 1, \"textOrientation\": 0}, \"value\": \"License Revenue\"}}, \"6\": {\"1\": {\"style\": {\"borderTop\": {\"style\": 1}}, \"value\": \"Total Revenue\"}, \"2\": {\"style\": {\"borderTop\": {\"style\": 1}}}, \"3\": {\"style\": {\"borderTop\": {\"style\": 1}}}, \"4\": {\"style\": {\"borderTop\": {\"style\": 1}}}, \"5\": {\"style\": {\"borderTop\": {\"style\": 1}}}, \"6\": {\"style\": {\"borderTop\": {\"style\": 1}}}, \"7\": {\"style\": {\"borderTop\": {\"style\": 1}}}, \"8\": {\"style\": {\"borderTop\": {\"style\": 1}}}, \"9\": {\"style\": {\"borderTop\": {\"style\": 1}}}}, \"8\": {\"1\": {\"style\": {\"textIndent\": 1, \"textOrientation\": 0}, \"value\": \"Cost of Goods Sold\"}}, \"9\": {\"1\": {\"style\": {\"borderTop\": {\"style\": 1}}, \"value\": \"Gross Margin\"}, \"2\": {\"style\": {\"borderTop\": {\"style\": 1}}}, \"3\": {\"style\": {\"borderTop\": {\"style\": 1}}}, \"4\": {\"style\": {\"borderTop\": {\"style\": 1}}}, \"5\": {\"style\": {\"borderTop\": {\"style\": 1}}}, \"6\": {\"style\": {\"borderTop\": {\"style\": 1}}}, \"7\": {\"style\": {\"borderTop\": {\"style\": 1}}}, \"8\": {\"style\": {\"borderTop\": {\"style\": 1}}}, \"9\": {\"style\": {\"borderTop\": {\"style\": 1}}}}}, \"defaultDataNode\": {\"style\": {\"themeFont\": \"Body\"}}}, \"name\": \"Sheet1\", \"rows\": [null, null, {\"size\": 5}], \"index\": 0, \"theme\": \"Office\", \"columns\": [null, {\"size\": 216}], \"activeCol\": 1, \"activeRow\": 7, \"printInfo\": {\"paperSize\": {\"kind\": 1, \"width\": 850, \"height\": 1100}}, \"cellStates\": {}, \"selections\": {\"0\": {\"col\": 1, \"row\": 7, \"colCount\": 1, \"rowCount\": 1}, \"length\": 1}, \"topCellIndex\": 0, \"colHeaderData\": {\"defaultDataNode\": {\"style\": {\"themeFont\": \"Body\"}}}, \"leftCellIndex\": 0, \"rowHeaderData\": {\"defaultDataNode\": {\"style\": {\"themeFont\": \"Body\"}}}, \"autoMergeRangeInfos\": [], \"outlineColumnOptions\": {}}, \"Sheet2\": {\"data\": {\"dataTable\": {}}, \"name\": \"Sheet2\", \"index\": 1, \"theme\": \"Office\", \"cellStates\": {}, \"selections\": {\"0\": {\"col\": 0, \"row\": 0, \"colCount\": 1, \"rowCount\": 1}, \"length\": 1}, \"topCellIndex\": 0, \"colHeaderData\": {}, \"leftCellIndex\": 0, \"rowHeaderData\": {}, \"autoMergeRangeInfos\": [], \"outlineColumnOptions\": {}}}, \"version\": \"13.0.4\", \"customList\": [], \"sheetCount\": 2}','One of the cells is not showing the expected value. Double check the cells with red borders to ensure they match the instructions'),(11,1,2,3,'Income Statement Set Up','<p>Below costs of goods sold, are operating expenses. Operating expenses, sometimes shortened to OpEx, are all the costs to run a business that are not directly attributable to the product or service. This include things like salaries for administrative staff, marketing costs, the cost of office supplies. OpEx can be broken out into several line items that could be modeled individually. You could have separate line items for salaries, marketing costs, and facilities costs. In this model, we\'re going to project OpEx as one line item. Note: You may see Operating Expenses called \"Sales, General, and Administrative Expense\" or \"SG&amp;A\" for short.</p>\r\n\r\n                                        <p>The difference between your Gross Margin and the Operating Expenses is called \"Operating Income\". Frequently this is also known as \"Earnings Before Interest, Taxes, Depreciation, and Amortization\". Usually you see it shortened as \"EBITDA\". The name is fairly self-explanatory. This line item is the income the business makes, before you take in to account the line items below it.</p>\r\n\r\n                                        <p>In cell B12, type \"Operating Expenses\". In cell B13, type \"Operating Income (EBITDA)\". Format these line items the same way you did for Gross Margin and COGS</p>',0,'','{\"sheets\": {\"Sheet1\": {\"data\": {\"dataTable\": {\"1\": {\"1\": {\"style\": {\"font\": \"bold 14.6667px Calibri\", \"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}, \"value\": \"FakeSoftwareCo Income Statement\"}, \"2\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\",