ataNode\": {\"style\": {\"themeFont\": \"Body\"}}}, \"leftCellIndex\": 0, \"rowHeaderData\": {\"defaultDataNode\": {\"style\": {\"themeFont\": \"Body\"}}}, \"autoMergeRangeInfos\": [], \"outlineColumnOptions\": {}}, \"Sheet2\": {\"data\": {\"dataTable\": {}}, \"name\": \"Sheet2\", \"index\": 1, \"theme\": \"Office\", \"cellStates\": {}, \"selections\": {\"0\": {\"col\": 0, \"row\": 0, \"colCount\": 1, \"rowCount\": 1}, \"length\": 1}, \"topCellIndex\": 0, \"colHeaderData\": {}, \"leftCellIndex\": 0, \"rowHeaderData\": {}, \"autoMergeRangeInfos\": [], \"outlineColumnOptions\": {}}}, \"version\": \"13.0.4\", \"customList\": [], \"sheetCount\": 2}','One of the cells is not showing the expected value. Double check the cells with red borders to ensure they match the instructions'),(14,1,3,1,'Balance Sheet Set Up','<p>Now that we\'ve outlined our income statement. The next step is to lay out the balance sheet. As previously mentioned, the balance sheet shows you all the assets a company has and how those assets were funded at the end of a time period. It\'s called a balance sheet because the Assets have to balance with the liabilities and equity that the company has. This equation, A = L+E, is central to accounting.</p>\r\n\r\n                                        <p>The balance sheet is structured to match the accounting equation. First come your assets, then your liabilities, and then the equity the company has. Within the assets and liabilities section, it is further divided in to current and long-term items. Current items are items that you are owed or owe within one year of the balance sheet date.</p>\r\n\r\n                                        <p>Similar to the Income Statement, the first thing we need to do label this section of our model. Instead of starting from scratch, we can copy and modify the heading we used on the Income Statement. Select cells B2:J4. Use \"Ctrl-C\" to copy them. Then use \"Ctrl-V\" to paste that in cell B24. Then modify the text in ce