. PP&amp;E is the value of all those physical assets.</p>\r\n\r\n                                        <p>Goodwill is an asset created when one company buys another. Any part of the purchase price that is greater than the companyâ€™s assets is added to the purchasing companies balance sheet as Goodwill.</p>\r\n\r\n                                        <p>Intangibles are the asset that corresponds with Amortization. It could include things like brand recognition and intellectual property, such as patents, trademarks, and copyrights.</p>\r\n\r\n                                        <p>Finally, \"Other long-term assets\" are assets you have that do not fall into the remaining categories. It could include things like long term investments.</p>\r\n\r\n                                        <p>Starting in cell B33, input \"PP&amp;E, net\", \"Goodwill\", \"Intangibles\", and \"Other long-term assets\". Then, in cell B37, put \"Total Assets\". Format so that Total Assets is a subtotal.</p>',0,'','{\"sheets\": {\"Sheet1\": {\"data\": {\"dataTable\": {\"1\": {\"1\": {\"style\": {\"font\": \"bold 14.6667px Calibri\", \"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}, \"value\": \"FakeSoftwareCo Income Statement\"}, \"2\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"3\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"4\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"5\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"6\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"7\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"8\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"9\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}}, \"3\": {\"1\": {\"style\": {\"