tatement Metrics','<p>For Depreciation and Amortization, we\'re going to calculate that as a percentage of Capital expenditures. Depending on the stage of the company, the relationship between depreciation and capex will vary. For companies that are growing quickly, you would expect Depreciation to be less than Capex. That\'s because the company is having to invest more every year than they did in the past. For companies that are stable, you\'d expect capex and depreciation to be roughly equal. Every year you\'d invest the same amount you have in prior years.</p>\r\n\r\n                                        <p>Since this company is growing, we\'re going to assume that D&amp;A is less than the companyâ€™s capex.</p>\r\n\r\n                                        <p>Add a line above \"Interest Expense\". Then below \"Earnings Before Interest and Tax\" type \"% D&amp;A of CapEx\". Normally, you would use the information from the primary data source to calculate this. As a simplifying assumption in this model, we\'re going to give you the historical values. In column C, type \"50%\". In Column D, type \"53%\". In Column E, type \"46%\". Format the cells as you have the other percentages.</p>\r\n\r\n                                        <p>Since these are hard coded numbers, we also want to color them blue, so that someone else looking at the model knows it\'s not a calculation.</p>',0,'','{\"sheets\": {\"Sheet1\": {\"data\": {\"dataTable\": {\"1\": {\"1\": {\"style\": {\"font\": \"bold 14.6667px Calibri\", \"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}, \"value\": \"FakeSoftwareCo Income Statement\"}, \"2\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"3\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"4\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"5\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Backgrou