INSERT INTO `lesson_steps` VALUES (64,1,10,1,'Cashflow Statement Projection','<p>Now we\'re going to start building out the Cashflow statement. The first line item is just Net Income.</p> \r\n\r\n                                        <p>We\'re going to skip Depreciation and Amortization until we project CapEx.</p>\r\n\r\n                                        <p>For \"Change in Net Working Capital\", we\'re going to take the difference between the prior years working capital and the current years working capital. If you\'re Working Capital increases from year to year, that means that you\'ve increased the amount of assets you have more than you\'ve increased the liabilities. An increase in assets is always going to correspond to a use of cash in a given year.</p>\r\n\r\n                                        <p>Set cell F76, equal to the companyâ€™s Net Income in cell F29. Copy the formula to the right for the forecast period. Format as a number with one decimal place.</p>\r\n										\r\n										<p>In cell F78, type \"=E63-F63\". Notice that this is a negative number. Since the working capital increased from 2019 to 2020, you have a cash outflow in 2020. Copy and paste the formula to the right for the forecast period. Format as a number with one decimal place in \"Comma Style\".</p>\r\n\r\n                                        <p>For \"(+/-) Change in other long-term assets &amp; liabilities\" calculate the difference in \"Other long-term assets\" and copy the formula to the right for the forecast period.</p>\r\n\r\n                                        <p>Then for the total \"Cash flow from operating activities\" use the formula \"=sum\" to take the total of the above rows. In cell F80, calculate the total, and copy right for the forecast period. Format as a number with one decimal in \"Comma Style\".</p>',0,'','{\"sheets\": {\"Sheet1\": {\"data\": {\"dataTable\": {\"1\": {\"1\": {\"style\": {\"font\": \"bold 14.6667px Calibri\", \"backColor\": \"rgb(0,