vities\" and type \"% of sales\" in cell B84. Indent and italicize it. If you had an underlying data set to pull the information from, you\'d want to base the % of sales off of the historical values. In this case, we\'re going to set it to \"0.9%\" of revenue.</p>\r\n\r\n                                        <p>Place \"0.9%\" in cell F84. Format as a percentage with one decimal place, italicize it, and color it blue. Carry it forward for the forecast period. Fill C84:E84 with the same gray fill you used previously</p>\r\n\r\n                                        <p>Since CapEx is a use of cash, we want it to be a negative number. Using the forecast metric calculate CapEx over the forecast period as a negative number.</p>\r\n\r\n                                        <p>Now for \"Cash flow from investing activities\", set it equal to capex for the entire forecast period. Format as a number with one decimal place in \"Comma Style\".</p>\r\n\r\n                                        <p>Now to calculate \"Cash Available for Financing Activities\", sum the \"Cash flow from operating activities\" and \"Cash flow from investing activities\". Carry the formula forward for the forecast period. Bold the numbers and format as a number with one decimal in \"Comma Style\".</p>',0,'','{\"sheets\": {\"Sheet1\": {\"data\": {\"dataTable\": {\"1\": {\"1\": {\"style\": {\"font\": \"bold 14.6667px Calibri\", \"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}, \"value\": \"FakeSoftwareCo Income Statement\"}, \"2\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"3\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"4\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"5\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"6\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"7\": {\"styl