stomList\": [], \"sheetCount\": 2}','One of the cells is not showing the expected value. Double check the cells with red borders to ensure they match the instructions'),(66,1,10,3,'Cashflow Statement Projection','<p>Now that we\'ve calculated CapEx, we can go back and calculate some of the line items that depend on it. Starting with D&amp;A. In cell F21, calculate D&amp;A based on the capex in 2020. Carry foward for the forcast period and format appropriately. Remember that even though CapEx is a negative number on the Cashflow statement, D&amp;A should be a positive number.</p>\r\n\r\n                                        <p>Now that we\'ve calculated D&amp;A. We can reference in the operating section of our Cashflow statement. In F77, reference the D&amp;A values for that year. Drag the formula forward for the forecast period. Format appropriately.</p>\r\n\r\n                                        <p>PP&amp;E also depends on CapEx and D&amp;A. To calculate the PP&amp;E balance, we want to add the CapEx for a given year and subtract the D&amp;A. The additional CapEx is money that you\'re spending to buy physical goods, so it increases the value of the PP&amp;E account. D&amp;A decreases the PP&amp;E account because the value of that equipment decreases over time. D&amp;A is the amount by which the value of those items is decreasing.</p>\r\n\r\n                                        <p>In cell F42, calculate the PP&amp;E balance for the forecast period. Format as a number with one decimal place. If you\'re having trouble figuring out the correct formula, check the hint below.</p>',0,'','{\"sheets\": {\"Sheet1\": {\"data\": {\"dataTable\": {\"1\": {\"1\": {\"style\": {\"font\": \"bold 14.6667px Calibri\", \"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}, \"value\": \"FakeSoftwareCo Income Statement\"}, \"2\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"3\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\",