": \"Body\"}}}, \"leftCellIndex\": 0, \"rowHeaderData\": {\"defaultDataNode\": {\"style\": {\"themeFont\": \"Body\"}}}, \"autoMergeRangeInfos\": [], \"outlineColumnOptions\": {}}, \"Sheet2\": {\"data\": {\"dataTable\": {}}, \"name\": \"Sheet2\", \"index\": 1, \"theme\": \"Office\", \"cellStates\": {}, \"selections\": {\"0\": {\"col\": 0, \"row\": 0, \"colCount\": 1, \"rowCount\": 1}, \"length\": 1}, \"topCellIndex\": 0, \"colHeaderData\": {}, \"leftCellIndex\": 0, \"rowHeaderData\": {}, \"autoMergeRangeInfos\": [], \"outlineColumnOptions\": {}}}, \"version\": \"13.0.4\", \"customList\": [], \"sheetCount\": 2}','One of the cells is not showing the expected value. Double check the cells with red borders to ensure they match the instructions'),(68,1,10,5,'Cashflow Statement Projection','<p>For this model, the only other cash account we\'re going to project is \"Repayment of long term debt\". The other cash accounts, \"Issuance of long-term debt\", \"Repurchase of equity\", \"Dividends\", and \"Proceeds from options\", are driven by specific actions that the company takes. If they take out an additional loan, do stock buybacks, or declare a dividend it would change these accounts, but they won\'t necessarily change over the normal course of business.</p>\r\n\r\n                                        <p>To calculate repayment of long-term debt, we first have to add a metric for \"% mandatory repayment\". You may also see mandatory repayment on a loan referred to as a loan\'s amortization. It\'s a different and unrelated use of the word than \"Depreciation and Amortization\". You would find this information by looking up the terms of the company\'s debt agreements. </p>\r\n\r\n                                        <p>Type \"% mandatory repayment\" in cell B105. In this case, we\'re going to use \"1%\" as the mandatory repayment amount. Type that in cell F105. Format as a percentage with no decimal places, and color it blue since it\'s a hard-coded value. Carry forward for the forecast period and format as you have the other forecast metrics.</p>\r\n										\r\n										<p>Then to calculate the mandatory repayment, you need to multiply the debt balance in a given year by the mandatory repayment amount. Since the debt repayment is a use of cash, we want to show it as a negative number.</p>\r\n\r\n                                        <p>In cell F92, type \"=-F105*F55\". Format as a number with one decimal place in \"Comma Style\". Copy to the right for the forecast period.</p>\r\n\r\n                                        <p>Now we can calculate our \"Long-term debt\" balance. For this account, we want to take the prior yearâ€™s value, add any new debt issued, and subtract the debt payed down. In cell F55, type \"=E55+F91+F92\".</p>\r\n\r\n                                        <p>Copy the formulas to the right for the forecasted period. Format as a number with one decimal place.</p>\r\n\r\n                                        <p>Calculate the total \"Cash flow from financing activities\" by summing F90:F95. Copy the formula to the right for the forecast period. Bold and format as a number with one decimal place in \"Comma Style\".</p>',0,'','{\"sheets\": {\"Sheet1\": {\"data\": {\"dataTable\": {\"1\": {\"1\": {\"style\": {\"font\": \"bold 14.6667px Calibri\", \"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}, \"value\": \"FakeSoftwareCo Income Statement\"}, \"2\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"3\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"4\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"5\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"6\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"7\": {\"style\": {\"backColor\": \"rgb(0, 32, 96)\", \"foreColor\": \"Background 1\"}}, \"8\": {\"style\